import React from 'react';
import Header from './Header';
import Filters from './Filters';
import CharacterList from './CharacterList';
import HarryPotterSoundtrack from '../audio/HarryPotterSoundtrack.mp3';
import Footer from './Footer';
import PropTypes from 'prop-types';

class Home extends React.Component {
  render() {
    const { characters, filterName, handleFilterName } = this.props;
    return (
      <React.Fragment>
        <Header />
        <main className="app__main">
          <Filters
            filterName={filterName}
            handleFilterName={handleFilterName}
          />
          <CharacterList characters={characters} filterName={filterName} />
        </main>
        <footer className="app__footer">
          <audio autoPlay src={HarryPotterSoundtrack} id="pDst9A3sqis" />
          <p className="footer__name">Create by Ana JD</p>
          <p className="footer__copy">&copy; 2019</p>
        </footer>
        {/* <Footer /> */}
      </React.Fragment>
    );
  }
}

Home.propTypes = {
  characters: PropTypes.array,
  filterName: PropTypes.string,
  handleFilterName: PropTypes.func
};

export default Home;
